import React, { Component } from 'react';

export default class Contacts extends Component{
render(){
    return(
        <div>
           //Inspired by @pepelsbey CSS Slider
.slider

	input.slider__check( type="radio", id="slider__check-1", name="slider__check" checked )
	label.slider__label(for="slider__check-1") 1
	.slider-item
		span.slider-item__header GoodDesign Is Good Business

	input.slider__check( type="radio", id="slider__check-2", name="slider__check" )
	label.slider__label(for="slider__check-2") 2
	.slider-item
		span.slider-item__header Lorem Ipsun

	input.slider__check( type="radio", id="slider__check-3", name="slider__check" )
	label.slider__label(for="slider__check-3") 3
	.slider-item
		span.slider-item__header Consectetur adipiscing elit


        </div>
    )}
}
